-- Triggers structure for table tbl_favorite
-- ----------------------------
DROP TRIGGER IF EXISTS `after_insert_tbl_favorite`;
delimiter ;;
CREATE TRIGGER `after_insert_tbl_favorite` AFTER INSERT ON `tbl_favorite` FOR EACH ROW BEGIN
		UPDATE tbl_radio SET
				favorite = (SELECT COALESCE(COUNT(fa.id_radio), 0) FROM tbl_favorite fa WHERE fa.id_radio = NEW.id_radio)
		WHERE id = NEW.id_radio;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table tbl_favorite
-- ----------------------------
DROP TRIGGER IF EXISTS `after_delete_tbl_favorite`;
delimiter ;;
CREATE TRIGGER `after_delete_tbl_favorite` AFTER DELETE ON `tbl_favorite` FOR EACH ROW BEGIN
		UPDATE tbl_radio SET
				favorite = (SELECT COALESCE(COUNT(fa.id_radio), 0) FROM tbl_favorite fa WHERE fa.id_radio = OLD.id_radio)
		WHERE id = OLD.id_radio;
END
;;
delimiter ;

